import React from 'react'
import './Showall.css'
import Sidebar from './Sidebar'
import Buttons from './Buttons'
import FetchAPI from './FetchAPI'
// import { Link } from 'react-router-dom'
import { useNavigate } from 'react-router-dom'
// import { useEffect, useState } from 'react'

function Showalladmin({ name }) {
  const data = FetchAPI("http://localhost:8000/api/show-all-admin");

  const deleteData = async (employeeId) => {
    try {
      let response = await axios.post('http://localhost:8000/api/delete-admin', {
        employeeId:employeeId,
      });
    }
    catch(error){
      console.log(error);
    }
  };

  const navigate = useNavigate();
      const navigatetoeditdetails = (id) => {
        const combinedState = { data1: id};
        navigate(`/edit/${id}`, {state: combinedState });
      };

      const navigatetodelete = (id) => {
        deleteData(id);
        
      };
  return (
    <div id='main'>
      <Sidebar />
      <div id='search'>
        <h4>{name}</h4>
        <div className='searchoption'>
          <span>S.R. No.</span>
          {/* <span>Profile</span> */}
          <span>Name</span>
          <span>ID</span>
          <span>Office Email</span>
          <span>Contact Number</span>
          <span>Position</span>
          <span>Documents</span>
          <span>Edit</span>
          <span>Delete</span>
        </div>
        {
          data.map((data, index) => {
            return (
              <div key={index} className='searchoption'>
                <span>{index+1}</span>
                {/* <span><img src="C:/xampp/htdocs/Payroll/Back-End/storage/app/public/profile/"{data.profile_pic} alt='error'/></span> */}
                <span>{data.name}</span>
                <span>{data.employeeId}</span>
                <span>{data.officeEmail}</span>
                <span>{data.contactNo}</span>
                <span>{data.designation}</span>
                <select>
                  <option value="select letter"><button>select letters</button></option>
                  <option value="Relieving Letter"><button>Relieving</button></option>
                  <option value="Experience Letter"><button>Experience</button></option>
                  <option value="Offer Letter"><button>Offer</button></option>
                  <option value="Salary Increment Letter"><button>Salary Increment</button></option>
                  <option value="Joining Letter"><button>Joining</button></option>
                </select>
                <button onClick={()=>{navigatetoeditdetails(data.employeeId)}}>Edit</button>
                <button onClick={()=>{navigatetodelete(data.employeeId)}}>Delete</button>
              </div>
            )
          })
        }
      </div>
      <Buttons />
    </div>
  )
}

export default Showalladmin
